    const FixedBtnStyled = styled.div`
      position: fixed;
      bottom: 2rem;
      left: 4rem;
      border: .5rem solid var(--bg-main);
      width: 5rem;
      height: 5rem;

    `

    return (
        <FixedBtnStyled>
            <UilPalette />
        </FixedBtnStyled>
    );
};

export default FixedButton;
